final List<dynamic> styles = ['.app-bar-button {\n  width: 56px;\n  height: 56px;\n  padding: 14px;\n  cursor: pointer;\n  user-select: none;\n  transition: background-color 250ms ease, opacity 150ms ease, transform 250ms ease;\n}\n.app-bar-button.active {\n  background: #152451;\n}\n@media only screen and (min-width: 768px) {\n  .app-bar-button {\n    width: 60px;\n    height: 60px;\n  }\n}\n\n.scrolling-blocked {\n  position: fixed;\n  left: 0;\n  right: 0;\n  z-index: 1;\n  overflow: hidden;\n}\n\n.page-title {\n  display: none;\n}\n@media only screen and (min-width: 768px) {\n  .page-title {\n    display: flex;\n    flex-flow: row;\n    align-items: center;\n    justify-content: space-between;\n    padding-top: 20px;\n  }\n  .page-title h3 {\n    color: #ffffff;\n    font-weight: 600;\n    font-size: 30px;\n    text-transform: uppercase;\n  }\n}\n\n@media only screen and (min-width: 1024px) {\n  .content-wrapper {\n    margin: 0 auto;\n    width: 70%;\n    min-width: 850px;\n    padding: 100px 0;\n  }\n}\n.grid-container {\n  display: flex;\n  flex-flow: row wrap;\n}\n\nvegenews-poster {\n  width: calc(100% / 2);\n  min-height: 243px;\n  cursor: pointer;\n}\n\n@media only screen and (min-width: 412px) {\n  vegenews-poster {\n    min-height: 312px;\n  }\n}\n@media only screen and (min-width: 650px) {\n  vegenews-poster {\n    width: calc(100% / 3);\n    min-height: 327px;\n  }\n}\n@media only screen and (min-width: 768px) {\n  vegenews-poster {\n    box-shadow: 1px 1px 8px 2px rgba(0, 0, 0, 0.32);\n    margin-top: 1.5em;\n    margin-right: 1.5em;\n    width: calc(100% / 3 - 1em);\n    min-height: 343px;\n  }\n\n  .grid-container :nth-child(3n) {\n    margin-right: 0;\n  }\n}\n@media only screen and (min-width: 1024px) {\n  vegenews-poster {\n    width: calc(100% / 3 - 1em);\n    min-height: 404px;\n  }\n\n  .grid-container {\n    margin: 0;\n  }\n\n  .grid-container :nth-child(3n) {\n    margin-right: 0;\n  }\n}\n@media only screen and (min-width: 1800px) {\n  ve